      .filter(line => {
        val isJson = line.startsWith("{\"") && line.endsWith("}")
        // 我们获取 itemlist 里面的 status 如何为 hide ，则直接过滤
        var isShow = false
        if (isJson) {
          val json = new JSONObject(line)
          val status = json.getJSONObject("mods").getJSONObject("itemlist").getString("status")
            isShow = status.equals ("show") // 是否是 show 的数据
            }
            isJson & isShow
            })
      .flatMap(line => {
        val json = new JSONObject(line)
        val goods = json.getJSONObject("mods").getJSONObject("itemlist").getJSONObject("data").getJSONArray("auctions")
        var list = ListBuffer[JSONObject]()
        // 将 jsonarray 转换为 scala 支持的列表
        for (i <- 0 to goods.length() - 1) {
          list.append(goods.getJSONObject(i))
        }
        list
      })
      .map(line => {
        val view_price = line.getString("view_price").toFloat
        var price_name = ""
        if (view_price >= 3000) {
          price_name = "3000~10000 元 "
        } else if (view_price >= 1000) {
          price_name = "1000~3000 元 "
        } else if (view_price >= 500) {
          price_name = "500~1000 元 "
        } else if (view_price >= 250) {
          price_name = "250~500 元 "
        } else if (view_price >= 150) {
          price_name = "150~250 元 "
        } else if (view_price >= 80) {
          price_name = "80~150 元 "
        } else {
          price_name = "1~80 元 "
        }
        var view_sales = 0
        try {
          view_sales = line.getString("view_sales").replace("人付款", "").toInt
        } catch {
          case e: Exception => {
            println(" 付款为零 ")
          }
        }
        (price_name, view_sales) // 价格区间， 购买人数
      })
      .reduceByKey(_ + _)
      .take(8)
      .foreach(line => println("{value:" + line._2 + ",name:'" + line._1 + "'},"))
    sc.stop()
  }
}
